import Dashboard from "../page/Dashboard"
import Home from "../page/home/Home"
import About from "../page/aboutUs/index"
import Contact from "../page/contact/index"
export const indexRouter: any = {
    path: '/',
    element: (<Dashboard />),
    children: [
        {
            path : '/',
            element: ( <Home />),
        },{
            path :'/about',
            element :(<About />),
        },{
            path : '/contact',
            element: (<Contact />),
        }
    ]
    

}
